import React, { Component } from "react";
class Login extends Component
{

    render()
    {
        return (
            <div>
                <div className="loginbox">
                    <h1 className='mt-5 mb-5'><b>Login Here</b></h1>

                    <div className="alert alert-info" >
                        Logged In Successfully. You can <a href="/">Continue</a>.
                    </div>
                    <form>
                        <p>Email</p>
                        <input onChange={this.handleChange("email")} type="text" maxLength="30" className="form-control" placeholder="Enter Email" />
                        <p>Password</p>
                        <input onChange={this.handleChange("password")} type="password" className="form-control" placeholder="Enter Password"  />
                        <input onClick={this.clickSubmit} type="submit" value="Login" className="button"/>
                        <b>Don't have an account?</b>
                        <a href="/sign">Sign Up</a>
                    </form>
                </div>
            </div>
        );
    }
}

export default Login;
